import * as React from 'react';
import {ImageCardList} from '../../components/ChooseImage';
import {Summary} from '../../components/Summary';


interface IPage{
    dpage: string;
}

export interface OBuild{
    istate : IBuild;
}

export interface IBuild{
    id: string;
    cost: string;
    name: string;
    version: string;
    instance: string;
    memory: string;
    type: string;
    networks:string;
    securityGroup:string;
}


interface Bigprops {
    props:IPage;
    stateprops:OBuild;
}

// export function PageDisplay(props : IPage,stateprops:OBuild)  {
export function PageDisplay(bgprops:Bigprops)  {    
    // const nav = props;

    if(props.dpage=="1"){
    return(
        <ImageCardList/>
    );
    }else if(props.dpage=="2"){
    return(
        <h1>HI</h1>
    );
    }else if(props.dpage=="3"){
    return(
        <h1>HI</h1>
    );
    }else if(props.dpage=="4"){
    return(
        <h1>HI</h1>
    );
    }else if(props.dpage=="5"){
    return(
        <Summary stateprops={stateprops}/>
    );

    }

    return null;

};

